import React from 'react';
import { Route, Switch, withRouter } from 'react-router';
import App2 from "./App";
import {LikeList} from "./views/likes";
import {STRUCTURE} from "./constants";
import {_Memes} from "./components/Memes"
import {_YourCat} from "./components/YourCat"
const MainRouter = () => (
    <Switch>
        <Route exact path='/' component={App2}/>
        <Route path={STRUCTURE.memes.route} component={_Memes}/>
        <Route path={STRUCTURE.videos.route} component={_YourCat}/>
        <Route path={STRUCTURE.login.route} component={_YourCat}/>

    </Switch>
);

export default withRouter(MainRouter);
